import React from 'react';
import { createRoot } from 'react-dom'; // Import createRoot from react-dom
import Background from '../components/Background';
import Logo from '../components/Logo';
import Header from '../components/Header';
import Button from '../components/Button';
import Paragraph from '../components/Paragraph';

export default function StartScreen({ navigation }) {
  return (
    <Background>
      <Logo />
      <Header>Start Up!</Header>
      <Paragraph>
        The easiest way to order food.
      </Paragraph>
      <Button
        mode="contained"
        onPress={() => navigation.navigate('LoginScreen')}
      >
        Login
      </Button>
      <Button
        mode="outlined"
        onPress={() => navigation.navigate('RegisterScreen')}
      >
        Sign Up
      </Button>
    </Background>
  );
}

// Entry point for rendering the component
const rootElement = document.getElementById('root'); // Replace 'root' with your target DOM element ID

const reactRoot = createRoot(rootElement); // Create a React root

reactRoot.render(
  <React.StrictMode>
    <StartScreen />
  </React.StrictMode>
);
